// Process ALL company data from Google Sheets
const allInputs = $input.all();
const configData = $('Configuration').first().json;

// Extract company data from all inputs
const companies = allInputs.map((inputItem, index) => {
  const row = inputItem.json;
  return {
    id: index + 1,
    ticker: row.Symbol?.trim() || '',
    industry: row.Industry?.trim() || '',
    competitors: row.Competitors?.trim() || '',
    cik: row.CIK?.trim() || ''
  };
}).filter(company => company.ticker);

// Add configuration to each company
const processedCompanies = companies.map(company => ({
  ...company,
  config: {
    recipientEmail: configData.recipientEmail,
    reportDate: new Date().toISOString().split('T')[0],
    processedAt: new Date().toISOString()
  }
}));

return [
  {
    json: {
      companies: processedCompanies,
      metadata: {
        totalCompanies: processedCompanies.length,
        reportDate: new Date().toISOString().split('T')[0],
        startTime: new Date().toISOString(),
        recipientEmail: configData.recipientEmail
      }
    }
  }
];

// Combine summaries and insights for refinement
const companyData = $('Combine Agent Results').first().json;
const summaries = $('Call Summarization Agent').first().json;
const insights = $('Call Insight Generation Agent').first().json;

// Structure data for the refinement agent
return {
  reportData: {
    ticker: companyData.ticker,
    stockPrice: companyData.companyData.stockPrice,
    summaries: summaries.summaries || {},
    keyInsight: insights.insight || { text: 'No insight available' },
    metadata: {
      processedAt: new Date().toISOString()
    }
  }
};

// Store refined company report
const refinedData = $input.first().json;
const originalData = $('Combine Agent Results').first().json;

return {
  ticker: originalData.ticker,
  refinedReport: refinedData.refinedReport || { text: 'Report generation failed' },
  completedAt: new Date().toISOString()
};

// Collect all company reports for final delivery
const allReports = $input.all();
const metadata = $('Process Company List').first().json.metadata;

// Structure final report data
const finalReportData = {
  reportMetadata: {
    reportDate: metadata.reportDate,
    generatedAt: new Date().toISOString(),
    recipientEmail: metadata.recipientEmail
  },
  companies: allReports.map(report => ({
    ticker: report.json.ticker,
    refinedReport: report.json.refinedReport
  }))
};

return {
  finalReportData: finalReportData
};

// Prepare companies for looping
const input = $input.first().json;
const companies = input.companies || [];

// Return each company as a separate item for the loop
return companies;

// Transform coordinator data for ALL agents
const companyData = $input.first().json;

console.log('Processing company:', companyData.ticker);

return [
  // Item 1: For Stock Price Agent
  {
    agentType: 'stockPrice',
    ticker: companyData.ticker
  },

  // Item 2: For Company Research Agent  
  {
    agentType: 'companyResearch',
    ticker: companyData.ticker,
    competitors: companyData.competitors,
    cik: companyData.cik
  },

  // Item 3: For Industry Research Agent
  {
    agentType: 'industryResearch',
    industry: companyData.industry,
    ticker: companyData.ticker
  },

  // Item 4: For Social Media Agent
  {
    agentType: 'socialMedia',
    ticker: companyData.ticker,
    companyName: companyData.ticker
  },

  // Item 5: For Macroeconomic Agent
  {
    agentType: 'macroeconomic',
    ticker: companyData.ticker,
    industry: companyData.industry
  }
];

// Now we have all 5 agent results in a single execution
const allInputs = $input.all();

console.log('Total agent results received:', allInputs.length);

// Initialize combined results
let combinedResults = {
  ticker: null,
  stockPrice: null,
  companyResearch: null,
  industryResearch: null,
  socialMedia: null,
  macroeconomic: null,
  metadata: {
    processedAt: new Date().toISOString(),
    totalAgents: allInputs.length
  }
};

// Process each agent result
allInputs.forEach((input, index) => {
  const data = input.json;

  console.log(`Agent ${index + 1} keys:`, Object.keys(data));

  // Extract ticker
  if (data.ticker && !combinedResults.ticker) {
    combinedResults.ticker = data.ticker;
  }

  // Detect agent type
  if (data.stockData || Object.keys(data).some(key => key.match(/^\d{4}-\d{2}-\d{2}$/))) {
    combinedResults.stockPrice = data;
    console.log(`Agent ${index + 1}: Stock Price`);
  }
  else if (data.companyNews || data.competitorNews || data.secFilings) {
    combinedResults.companyResearch = data;
    console.log(`Agent ${index + 1}: Company Research`);
  }
  else if (data.industryNews) {
    combinedResults.industryResearch = data;
    console.log(`Agent ${index + 1}: Industry Research`);
  }
  else if (data.socialMentions) {
    combinedResults.socialMedia = data;
    console.log(`Agent ${index + 1}: Social Media`);
  }
  else if (data.economicNews) {
    combinedResults.macroeconomic = data;
    console.log(`Agent ${index + 1}: Macroeconomic`);
  }
  else {
    console.log(`Agent ${index + 1}: Unidentified -`, Object.keys(data));
  }
});

console.log('Successfully combined all agent results');
return combinedResults;

