={{(() => {
  try {
    const parsed = $json;
    const timeSeries = parsed.debug?.allInputs?.[0]?.["Time Series (Daily)"];
    if (!timeSeries) return "No time series data found.";
    const latestDate = Object.keys(timeSeries).sort().reverse()[0];
    const closePrice = timeSeries[latestDate]?.["4. close"];
    return closePrice
      ? `$${parseFloat(closePrice).toFixed(2)} (as of ${latestDate})`
      : "No close price.";
  } catch (e) {
    return `Error parsing JSON: ${e.message}`;
  }
})()}}
